import axios, { AxiosError } from 'axios';
import { useDispatch } from 'react-redux';
import { loadUserRequest, loadUserSuccess, loadUserFail } from '../userSlice'; // Adjust the import path as needed

interface ErrorResponse {
    message: string;
}

const GetUser = () => {
    const dispatch = useDispatch();

    const fetchUser = async () => {
        try {
            dispatch(loadUserRequest());

            // Specify the expected response structure
            const response = await axios.get<{ user: any }>(
                'http://localhost:5001/api/logedin/user',
                { withCredentials: true }
            );

            // Access the nested user object correctly
            dispatch(loadUserSuccess(response.data.user));
        } catch (error) {
            const axiosError = error as AxiosError<ErrorResponse>; // Use AxiosError with ErrorResponse type

            // Safely access the message property
            const errorMessage = axiosError.response?.data?.message || 'Failed to fetch user';
            console.error(errorMessage);

            dispatch(loadUserFail(errorMessage));
        }
    };

    return { fetchUser };
};

export default GetUser;
